import React from "react";
import { Header } from "../atoms/Header";

const Login = () => {
  return (
    <div>
      <Header />
      <div className="bg-blueOne m-auto w-[40%] mt-20">
        <p className="text-2xl text-redOne py-12"> Login to your Account</p>
      </div>
    </div>
  );
};

export { Login };
